import { HomeRounded, LocalOfferRounded, AccountCircleRounded, ShoppingCartRounded } from "@material-ui/icons";

const HeaderMenu = [{ navLink_text: "Home", navLink_icon: <HomeRounded />, navLink_path: "/" }, {
    navLink_text: "About", navLink_icon: <LocalOfferRounded />, navLink_path: "/offers"
}, {
    navLink_text: "Blog", navLink_icon: <AccountCircleRounded />, navLink_path: "/account"
}, { navLink_text: "Pricing", navLink_icon: <ShoppingCartRounded />, navLink_path: "/cart" }, {
    navLink_text: "Contact"
}];

export default HeaderMenu;
